    return signed > 0 ? <Item /> : <Signin />;
};

const RoutesApp = () => {

    return(
        <BrowserRouter>
        <Fragment>
            <Routes>
                <Route exact path="/home" element={<Private Item={Home} />} />
                <Route path="/" element={<Signin />} />
                <Route exact path="/signup" element={<Signup />} />
                <Route path="*" element={<Signin />} />
            </Routes>
        </Fragment>
        </BrowserRouter>
    )
}

export default RoutesApp;
